import "./App.scss";
import { InputSearch } from "./components/input/input.component";
import { Card } from "./components/card/card.component";
const App = () => {
    return (
        <div className="App">
            <div className="header-container">
                <h1>Api search</h1>
            </div>
            <div className="input-container">
                <InputSearch />
            </div>

            <div className="card-container"></div>
        </div>
    );
};

export default App;
